import { createIcon } from "../icon/createIcon";

export const UploadIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="UploadIcon">
    <path d="m3 4 2.985-4L9 4l-2.02.001V9H4.99V4.001L3 4zm-3 7h12v1H0v-1z" />
  </svg>,
  "Upload",
  "upload"
);
